      "content": "\u003cdiv class\u003d\"introduction img-head\"\u003e\r\n  \u003cdiv class\u003d\"header\"\u003e\r\n    \u003cimg src\u003d\"data:image/svg+xml;base64,\u003d\" alt\u003d\"\"\u003e\r\n    \u003ch3\u003eTensile Strength Prediction for Business Users\u003c/h3\u003e\r\n  \u003c/div\u003e\r\n\r\n  \u003csection\u003e\r\n    \u003ch4\u003eOverview\u003c/h4\u003e\r\n    \u003cp\u003e\r\n      This app enables business users in manufacturing to analyze and predict the tensile strength of metal alloys using machine learning models.\r\n      By examining key factors like composition, Brinell hardness, and yield strength, it provides actionable insights to improve quality consistency,\r\n      operational efficiency, and compliance with industry standards.\r\n    \u003c/p\u003e\r\n  \u003c/section\u003e\r\n\r\n  \u003csection\u003e\r\n    \u003ch4\u003eInput\u003c/h4\u003e\r\n    \u003cul\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e User Data\u003c/li\u003e\r\n      \r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e  Regression Model name\u003c/li\u003e\r\n      \r\n    \u003c/ul\u003e\r\n  \u003c/section\u003e\r\n\r\n  \u003csection\u003e\r\n    \u003ch4\u003eOutput\u003c/h4\u003e\r\n    \u003cul\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e Predicted tensile strength (e.g., UTS, Yield Point)\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e Correlation insights between chemical composition and strength\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e Trend charts for tensile strength patterns\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e Visualizations of operational variables affecting quality\u003c/li\u003e\r\n    \u003c/ul\u003e\r\n  \u003c/section\u003e\r\n\r\n  \u003csection\u003e\r\n    \u003ch4\u003eBenefits\u003c/h4\u003e\r\n    \u003cul\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e \u003cstrong\u003eQuality Assurance:\u003c/strong\u003e Predict outcomes to ensure product consistency and minimize defects.\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e \u003cstrong\u003eOperational Efficiency:\u003c/strong\u003e Supports data-driven manufacturing strategies and resource optimization.\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e \u003cstrong\u003eCustomization:\u003c/strong\u003e Users can choose models and features aligned with business-specific requirements.\u003c/li\u003e\r\n      \u003cli\u003e\u003cspan\u003e+\u003c/span\u003e \u003cstrong\u003eCompliance:\u003c/strong\u003e Helps meet industry and regulatory standards by proactively assessing material quality.\u003c/li\u003e\r\n    \u003c/ul\u003e\r\n  \u003c/section\u003e\r\n\u003c/div\u003e\r\n",
