      "content": "\u003cdiv class\u003d\"introduction img-head\"\u003e\n  \u003csection\u003e\n    \u003ch4\u003eData Description\u003c/h4\u003e\n    \u003cdiv class\u003d\"custom-table-container\"\u003e\n      \u003cdiv class\u003d\"custom-table-header\"\u003e\n        \u003ctable class\u003d\"custom-table\"\u003e\n          \u003cthead\u003e\n            \u003ctr\u003e\n              \u003cth\u003eField Name\u003c/th\u003e\n              \u003cth\u003eDescription\u003c/th\u003e\n            \u003c/tr\u003e\n          \u003c/thead\u003e\n        \u003c/table\u003e\n      \u003c/div\u003e\n\n      \u003cdiv class\u003d\"custom-table-body\"\u003e\n        \u003ctable class\u003d\"custom-table\"\u003e\n          \u003ctbody\u003e\n            \u003ctr\u003e\u003ctd\u003eAl\u003c/td\u003e\u003ctd\u003eComposition of Aluminium in the alloy.\u003c/td\u003e\u003c/tr\u003e\n            \u003ctr\u003e\u003ctd\u003eCu\u003c/td\u003e\u003ctd\u003eComposition of Copper in the alloy.\u003c/td\u003e\u003c/tr\u003e\n            \u003ctr\u003e\u003ctd\u003eSi\u003c/td\u003e\u003ctd\u003eComposition of Silicon in the alloy.\u003c/td\u003e\u003c/tr\u003e\n            \u003ctr\u003e\u003ctd\u003eZn\u003c/td\u003e\u003ctd\u003eComposition of Zinc in the alloy.\u003c/td\u003e\u003c/tr\u003e\n            \u003ctr\u003e\u003ctd\u003eMn\u003c/td\u003e\u003ctd\u003eComposition of Manganese in the alloy.\u003c/td\u003e\u003c/tr\u003e\n            \u003ctr\u003e\u003ctd\u003eFe\u003c/td\u003e\u003ctd\u003eComposition of Iron in the alloy.\u003c/td\u003e\u003c/tr\u003e\n            \u003ctr\u003e\u003ctd\u003eTi\u003c/td\u003e\u003ctd\u003eComposition of Titanium in the alloy.\u003c/td\u003e\u003c/tr\u003e\n            \u003ctr\u003e\u003ctd\u003eMg\u003c/td\u003e\u003ctd\u003eComposition of Magnesium in the alloy.\u003c/td\u003e\u003c/tr\u003e\n            \u003ctr\u003e\u003ctd\u003eResiduals\u003c/td\u003e\u003ctd\u003eComposition of residual elements in the alloy not accounted for in primary components.\u003c/td\u003e\u003c/tr\u003e\n            \u003ctr\u003e\u003ctd\u003eTensileStrengthYieldProof\u003c/td\u003e\u003ctd\u003eThe maximum stress a material can endure before it begins to permanently deform (yield point).\u003c/td\u003e\u003c/tr\u003e\n            \u003ctr\u003e\u003ctd\u003eUTS\u003c/td\u003e\u003ctd\u003eUltimate Tensile Strength â€” the maximum stress the material can withstand before breaking.\u003c/td\u003e\u003c/tr\u003e\n            \u003ctr\u003e\u003ctd\u003eBrinellHardness\u003c/td\u003e\u003ctd\u003eA measurement that indicates how hard a material is using the Brinell scale.\u003c/td\u003e\u003c/tr\u003e\n            \u003ctr\u003e\u003ctd\u003eFatigueStrength\u003c/td\u003e\u003ctd\u003eThe maximum cyclic stress a material can withstand without failing over repeated loading cycles.\u003c/td\u003e\u003c/tr\u003e\n          \u003c/tbody\u003e\n        \u003c/table\u003e\n      \u003c/div\u003e\n    \u003c/div\u003e\n  \u003c/section\u003e\n\u003c/div\u003e",
